package util;

public class SwitchMain {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s = "Case 2";
		switch (s) {
		case "Case 1":
			System.out.println("Case 1");
			break;
		default:
			System.out.println("Default");
			break;
		}

	}

}
